import React from "react";

function LeftSideMenu() {
  return (
    <aside>
      <ul>
        <li className="side-li"><a>Menu Item 1</a></li>
        <li className="side-li">Menu Item 2</li>
        <li className="side-li">Menu Item 3</li>
      </ul>
    </aside>
  );
}

export default LeftSideMenu;
